package Entity;import java.time.LocalDate;import java.util.List;public class SettlementRecord {    private Float outgoingSettlementAmount;    private Float incomingSettlementAmount;    private LocalDate settlementDate;    private List<String> entityRanking;    public SettlementRecord() {    }    public SettlementRecord(Float outgoingSettlementAmount, Float incomingSettlementAmount, LocalDate settlementDate) {        this.outgoingSettlementAmount = outgoingSettlementAmount;        this.incomingSettlementAmount = incomingSettlementAmount;        this.settlementDate = settlementDate;    }    public Float getOutgoingSettlementAmount() {        return outgoingSettlementAmount;    }    public void setOutgoingSettlementAmount(Float outgoingSettlementAmount) {        this.outgoingSettlementAmount = outgoingSettlementAmount;    }    public Float getIncomingSettlementAmount() {        return incomingSettlementAmount;    }    public void setIncomingSettlementAmount(Float incomingSettlementAmount) {        this.incomingSettlementAmount = incomingSettlementAmount;    }    public LocalDate getSettlementDate() {        return settlementDate;    }    public void setSettlementDate(LocalDate settlementDate) {        this.settlementDate = settlementDate;    }    public List<String> getEntityRanking() {        return entityRanking;    }    public void setEntityRanking(List<String> entityRanking) {        this.entityRanking = entityRanking;    }}